const e = createEngine(gameCanvas, 300, 300);

e.addText("The arrows break", 190, 38);
e.addText("whatever they touch", 216, 38 + 16);
e.addText("even themselves", 216, 38 + 16*2);

e.addText("can you make them", 84, 234);
e.addText("spawn only when a", 94, 234 + 16);
e.addText("key is pressed?", 104, 234 + 16*2);


/* BEGIN TARGET */
e.add({
  sprite: target,
  x: 230,
  y: 230,
  scale: 2,
})
/* END TARGET */

/* BEGIN BOW */
e.add({
  sprite: bow_sprite,
  x: 40,
  y: 40,
  origin: [0.5, 0.5],
  scale: 4,
  rotate: 45,
  update(bow) {
    /* BEGIN ARROW */
    e.add({
      x: bow.x,
      y: bow.y,
      origin: [0.5, 0.5],
      sprite: arrow,
      vx: 100,
      vy: 100,
      scale: 2,
      collides(me, thing) {
        if (thing != bow) {
          e.remove(me);
          e.remove(thing);
        }
      }
    })
    /* END ARROW */
  }
})
/* END BOW */

/* BEGIN OBSTACLES */
for (let i = 0; i < 5; i++) {
  e.add({
    sprite: tile,
    x: 85 + i * 24,
    y: 85 + i * 24,
    scale: 1.5,
  })
}
/* END OBSTACLES */

e.start();
